import React, { useEffect, useState } from 'react';
import { useParams, useLocation, useNavigate } from 'react-router-dom';

const EvaluationDetail = () => {
  const { evaluationId } = useParams();
  const location = useLocation();
  const navigate = useNavigate();
  const isCreateMode = location.state?.isCreateMode || false;
  const fromDashboard = location.state?.from === 'dashboard';

  const [formData, setFormData] = useState({
    id: '',
    id_producto: '',
    id_usuario: '',
    id_tipo_evaluacion: '',
    fecha_evaluacion: '',
    observaciones: ''
  });

  const [productoNombre, setProductoNombre] = useState('');
  const [usuarioNombre, setUsuarioNombre] = useState('');
  const [tipoEvaluacionNombre, setTipoEvaluacionNombre] = useState('');

  const token = localStorage.getItem('token');

  useEffect(() => {
    if (evaluationId && !isCreateMode) {
      fetch(`http://localhost:4000/api/evaluaciones/${evaluationId}`, {
        headers: {
          Authorization: `Bearer ${token}`
        }
      })
        .then(res => res.json())
        .then(data => {
          const evaluacion = data.body;
          setFormData({
            id: evaluacion.id,
            id_producto: evaluacion.id_producto,
            id_usuario: evaluacion.id_usuario,
            id_tipo_evaluacion: evaluacion.id_tipo_evaluacion,
            fecha_evaluacion: evaluacion.fecha_evaluacion.substring(0, 10),
            observaciones: evaluacion.observaciones
          });
        })
        .catch(err => console.error('Error al obtener la evaluación:', err));
    }
  }, [evaluationId, isCreateMode, token]);

  useEffect(() => {
    if (formData.id_producto) {
      fetch(`http://localhost:4000/api/productos/${formData.id_producto}`, {
        headers: {
          Authorization: `Bearer ${token}`
        }
      })
        .then(res => res.json())
        .then(data => setProductoNombre(data.body.nombre))
        .catch(err => console.error('Error al obtener el producto:', err));
    }
  }, [formData.id_producto, token]);

  useEffect(() => {
    if (formData.id_usuario) {
      fetch(`http://localhost:4000/api/usuarios/${formData.id_usuario}`, {
        headers: {
          Authorization: `Bearer ${token}`
        }
      })
        .then(res => res.json())
        .then(data => setUsuarioNombre(data.body.nombre))
        .catch(err => console.error('Error al obtener el usuario:', err));
    }
  }, [formData.id_usuario, token]);

  useEffect(() => {
    if (formData.id_tipo_evaluacion) {
      fetch(`http://localhost:4000/api/tipo-criterio/${formData.id_tipo_evaluacion}`, {
        headers: {
          Authorization: `Bearer ${token}`
        }
      })
        .then(res => res.json())
        .then(data => setTipoEvaluacionNombre(data.body.nombre_tipo_evaluacion))
        .catch(err => console.error('Error al obtener tipo de evaluación:', err));
    }
  }, [formData.id_tipo_evaluacion, token]);

  const handleGoBack = () => {
    if (fromDashboard) {
      navigate('/dashboard');
    } else {
      navigate('/evaluaciones');
    }
  };

  return (
    <div className="evaluation-detail">
      <h2>{isCreateMode ? 'Nueva Evaluación' : 'Detalle de Evaluación'}</h2>
      <div className="form-group">
        <label>ID Evaluación</label>
        <input type="text" value={isCreateMode ? 'Pendiente' : formData.id} readOnly />
      </div>
      <div className="form-group">
        <label>Producto</label>
        <input type="text" value={productoNombre} readOnly />
      </div>
      <div className="form-group">
        <label>Usuario</label>
        <input type="text" value={usuarioNombre} readOnly />
      </div>
      <div className="form-group">
        <label>Tipo de Evaluación</label>
        <input type="text" value={tipoEvaluacionNombre} readOnly />
      </div>
      <div className="form-group">
        <label>Fecha</label>
        <input type="text" value={formData.fecha_evaluacion} readOnly />
      </div>
      <div className="form-group">
        <label>Observaciones</label>
        <textarea value={formData.observaciones} readOnly />
      </div>
      <button onClick={handleGoBack}>Volver</button>
    </div>
  );
};

export default EvaluationDetail;
